import React, {
    Component
} from 'react'
import axios from 'axios';

class Data extends Component {


    constructor(props) {
        super(props);
        this.state = {
            imageURL: '',
            numerot: [],
        }
    }

    componentDidMount() {

        //localhost
        axios.get('http://192.168.220.139:9595/users/?format=json', {}, {
            auth: {
              username: 'admin',
              password: 'deve'
            }
          }).then(resp => {
              this.numerot = resp.data;
              console.log(resp.data);
          })

        // axios.get('http://webcode.me').then(resp => {
        //    console.log(resp.data);
        // });
        // axios({
        //     auth: 'admin',
        //     password: 'deve',
        // }
        // .get('http://127.0.0.1:8000/users/?format=api').then(resp => {
        //         console.log(resp.data);
        // }));
    }


    //koiria
   // <img alt="123" src={imageURL} />
    render() {

        return ( 
            <div >
                <ul>
                {this.numerot.map(item => {
                    <li>{item[0]}</li>;
                })}
             </ul>
            </div>
        )
    }
}

export default Data
